import styled from "styled-components";

const MenuContainer = styled.div`
  height: 100vh;
  width: 100vw;
  .fixed;
  .top-0;
  .left-0;
  background: rgba(0, 0, 0, 0.3);
`;

const MenuItems = styled.div`
  .bg-pwhite;
  width: 100vw;
  height: 100vh;
  overflow-y: scroll;
  .fixed;
`;

const SideMenu = () => {
  return (
    <MenuContainer>
      <MenuItems></MenuItems>
    </MenuContainer>
  );
};

export default SideMenu;
